INSERT INTO `config` (`id`, `title`, `title_zh`, `content`, `content_zh`, `status`) VALUES
('disclaimer', 'Disclaimer', '免责声明', '<p style="box-sizing:border-box;margin-top:0px;margin-bottom:1.1em;color:#3F3F3F;font-family:&quot;font-size:18px;text-align:justify;white-space:normal;background-color:#F6F6F6;outline:none !important;">\r\n	Cubing China is an information sharing platform for speedsolving competitions. The information is provided by various organizing teams, and while we endeavour to urge all the organizing teams to keep the information up to date and correct, we make no representations or warranties of any kind, express or implied, about the completeness, accuracy, reliability, suitability or availability with respect to the information posted on our website and take no responsibilities for any behaviors of any organizing team or any individual organizer. These behaviors will include but not limited to the following.\r\n</p>\r\n<ol style="box-sizing:border-box;margin-top:0px;margin-bottom:1.1em;color:#3F3F3F;font-family:&quot;font-size:18px;text-align:justify;white-space:normal;background-color:#F6F6F6;outline:none !important;">\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		The actual implementation detail may not meet the information listed on Cubing China that are preannounced by the organizing team. Due to certain reasons, the organizing team may change the following pieces of information and their implementation:&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\na. The date and the venue of the competition&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\nb. The schedule and events of the competition&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\nc. The number of prizes&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\nd. The number of cash prizes&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\ne. The money transferring time and method of cash prizes&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\nCubing China is not responsible for any loss, damage, cost, or expense due to the incomplete, inaccurate information posted by any organizing team or any misbehavior of any organizing team or any individual organizer.\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		Cubing China offers online payment service to collect registration fees for competitions using our website. Any changes after the registration are not part of our payment service. Please contact the corresponding organizing team for further payments or refunds regarding your registration fees.\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		Cubing China does not oversee the money usage of any organizing team. For details of expenditure on registration fees, please contact the corresponding organizing team of competitions which you participated.\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		Cubing China does not sell any gifts or souvenirs at the moment, please contact the corresponding organizing team for customer service regarding gifts or souvenirs.\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		Cubing China takes no responsibilities for any accidents or disputes happened at the venue.\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		Cubing China takes no responsibilities for any accidents or disputes happened throughout the whole organizing process of any competitions whether it is within the organizing team or between the organizing team and a third party.\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		Results of non-WCA competitions will not be posted on Cubing China. Please contact the corresponding organizing team or related organizations for further announcements regarding your results.\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		Cubing China does not hold the copyright to any text, figure or illustration posted on our website. We do not endorse any views expressed or products or services offered by any organizing team.\r\n	</li>\r\n</ol>', '<p style="box-sizing:border-box;margin-top:0px;margin-bottom:1.1em;color:#3F3F3F;font-family:&quot;font-size:18px;text-align:justify;white-space:normal;background-color:#F6F6F6;outline:none !important;">\r\n	粗饼网只是赛事信息公开发布的平台与各比赛主办团队并无任何约束关系，不对各地主办团队的具体行为负责。这些具体行为包括且不限于：\r\n</p>\r\n<ol style="box-sizing:border-box;margin-top:0px;margin-bottom:1.1em;color:#3F3F3F;font-family:&quot;font-size:18px;text-align:justify;white-space:normal;background-color:#F6F6F6;outline:none !important;">\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		比赛具体实施与公布信息不符：&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\na. 比赛基本信息（比赛时间、地点、交通、住宿等）与公布信息不符。&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\nb. 比赛当日比赛项目、轮次、时间与公布的赛程不同。&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\nc. 比赛当日发放的奖品种类、数量与宣传上有差别。&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\nd. 比赛奖金的数目、发放的时间与方式与赛前公示有出入。&nbsp;<br style="box-sizing:border-box;outline:none !important;" />\r\n相关赛事信息以主办方官方公布的信息为准，若因以上原因导致参赛选手未能完赛或产生经济等方面损失与粗饼网无关。\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		赛事相关费用的增补与退还，由各地主办团队负责。粗饼网仅提供代收比赛报名费的业务，对于具体的增补、退还请联系比赛主办团队。\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		赛事报名费的明细开支，由各地主办团队负责。粗饼网仅提供代收部分赛事报名费。\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		比赛周边各类纪念品的出售、售后。粗饼目前没有任何周边纪念品出售，各类比赛周边纪念品的出售、售后请联系比赛主办方。\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		比赛现场的意外事件。任何在比赛现场发生的意外或纠纷与粗饼网无关。\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		主办团队内部纠纷或与第三方产生的纠纷。主办团队在比赛筹备、筹办、组织、实施的过程中产生的任何形式的纠纷与粗饼网无关，请联系利益相关方处理矛盾或纠纷。\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		非WCA比赛的成绩公示、成绩查询。对于非WCA比赛，请联系该赛事认证方、比赛组织团队查询比赛成绩。\r\n	</li>\r\n	<li style="box-sizing:border-box;outline:none !important;">\r\n		粗饼网所使用的文字、图片均是相关赛事的新闻报道，本站不持有相关版权。所有由用户发布的信息，不代表本站观点。\r\n	</li>\r\n</ol>', 1);
